import { useEffect, useState } from 'react';
import axios from 'axios';

export default function AdminDashboard() {
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('http://localhost:5000/feedbacks', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setFeedbacks(res.data);
      } catch (error) {
        console.error(error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-6">Feedback Dashboard</h1>
      
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white">
            <thead>
              <tr>
                <th className="py-2 px-4 border">Name</th>
                <th className="py-2 px-4 border">Course</th>
                <th className="py-2 px-4 border">Rating</th>
                <th className="py-2 px-4 border">Comments</th>
              </tr>
            </thead>
            <tbody>
              {feedbacks.map((feedback) => (
                <tr key={feedback._id}>
                  <td className="py-2 px-4 border">{feedback.name}</td>
                  <td className="py-2 px-4 border">{feedback.course}</td>
                  <td className="py-2 px-4 border">
                    {Array(feedback.rating).fill('⭐').join('')}
                  </td>
                  <td className="py-2 px-4 border">{feedback.comments}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
